const types = 'abcdefghijklmnopqrstuvwxyz'.split('')

function react (input) {
  let reacted = input
  let lastLength
  do {
    lastLength = reacted.length
    let i = 0
    while (i < reacted.length - 1) {
      if (willReact(reacted[i], reacted[i + 1])) {
        reacted = reacted.slice(0, i) + reacted.slice(i + 2)
      } else {
        i++
      }
    }
  } while (reacted.length < lastLength)
  return reacted
}

function improve (input) {
  const shortest = types.map(type => {
    const removed = input.replace(new RegExp(type, 'ig'), '')
    return react(removed).length
  })
  return shortest.reduce((min, v) => v < min ? v : min, input.length)
}

function willReact (a, b) {
  if (isLowerCase(a) && !isLowerCase(b)) return a === b.toLowerCase()
  else if (!isLowerCase(a) && isLowerCase(b)) return a.toLowerCase() === b
  else return false
}

function isLowerCase (char) {
  return /[a-z]/.test(char)
}

const test = ''

console.log(react(test).length)
console.log(improve(test))
